import React from "react";

import Card from 'react-bootstrap/Card';

const Header: React.FC = () => {
    return (
        <Card className="bg-dark text-white">
            <Card.Img src={`${process.env.PUBLIC_URL}/hutte.png`} alt="hutte.png" />
            <Card.ImgOverlay>
                <Card.Title>Kitamachi Hutte</Card.Title>
                <Card.Text>住宅街の山小屋風日本酒酒場</Card.Text>
            </Card.ImgOverlay>
        </Card>
    );
}

export default Header;
